import React from 'react';
import headerLogo from '../../images/vector/header__logo.svg'
import { Link, useNavigate } from 'react-router-dom';



function Header(props) {
    let navigate = useNavigate()
    console.log(props.onLogin);
    function signOut(){

        localStorage.removeItem('token');
        navigate('/sign-up');
        if(props.onLogin){
            props.setLogin(false)
            props.setLogin(true)
        }else{

        }

      }
    return (
        <div className='header'>
            <img className='header__logo' alt='logo' src={headerLogo} />
            <div className='header__login-box'>
            <h2 className='header__email'>{props.onEmail}</h2>
            <button onClick ={signOut} className='header__button'><Link to='/sign-in'>{props.onLogin ? 'Выйти': 'Войти' }</Link></button>
            </div>
        </div>
    )
}
export default Header
